import './App.css';
import { Outlet } from "react-router-dom";
import NavBar from './components/NavBar';
import Activities from './components/GetActivity';

function App() {  
    return (
        <>
            <NavBar />
            <GetActivities />
            <h1>{process.env.REACT_APP_MYENVVAR}</h1>
            <h1>WildSteppe Test</h1>
            <Outlet />
        </>
    )
}

export default App;
